import './App.css'

import Header from './components/header/header'
import Body from './components/body/body'


function App() {
  return (
    <div className="website">

      <div className="header">
        <Header />
      </div>

      <div className="body">
        <Body />
      </div>

    </div>

  );
}

export default App;
